OO.Data = OO.Data || {}; 

(function() {

	
	$('body').on('click', '.open-button', function () {
		let puzzleComponent = OO.Data.puzzleComponent;
		
		if (puzzleComponent) {
			puzzleComponent.openImageFile();
		}
	});
		
	// check
	$('body').on('click', '.finish-game', function () {
		let puzzleComponent = OO.Data.puzzleComponent;
		let sortArray = [];
		let pass = true;
		let message = '恭喜您，完成拼圖';

		if (puzzleComponent) {
			sortArray = puzzleComponent.getSortArray();
			for (let i = 0; i < 4 * 4; i++) {
				if (parseInt(sortArray[i]) !== (i + 1)) {
					pass = false;
				}
			};

			if (!pass) {
				message = '再加油一下，快成功囉';
			}

			alert(message);
		}
	});
	

}());

// DOM載入完成
$(document).ready(function(){
	let puzzleContainer = $('.puzzle-image-container');
	let puzzleComponent = null;
	let imageBase64 = 'data:image/jpeg;base64,';

	// create component
	puzzleComponent = new OO.Modules.PuzzleGameComponent({
		puzzleImageSrc: imageBase64,
		puzzleWidthCount: 4,
		puzzleHeightCount: 4,
		imageWidthMin: 400,
		imageHeightMin: 400
	}, puzzleContainer);

	OO.Data.puzzleComponent = puzzleComponent;
	
});
